          <p>Supplier: {savedData.supplier} </p>
          <p>Issue: {savedData.issue} </p>
          <p>Subcontract Production Order ID: {savedData.productionOrderId} </p>
          <p>Document Uploaded: {savedData.fileUpload} </p>
        </>
      </div>
    </div>
  );
}

export default Submitted;
